-- Step 2: Show analysis of call log data
SELECT 'Call Log Analysis:' as info, COUNT(*) as unique_phone_numbers FROM temp_all_call_log;

-- Step 3: Show loyalty level distribution
SELECT loyalty_level, COUNT(*) as count FROM temp_all_call_log GROUP BY loyalty_level ORDER BY count DESC;

-- Step 4: Update existing customers with call log data
UPDATE customers SET
    name = CASE WHEN customers.name = '__' OR customers.name IS NULL OR LENGTH(t.best_name) > LENGTH(customers.name) THEN t.best_name ELSE customers.name END,
    created_at = COALESCE(t.first_call_date::timestamp, customers.created_at),
    total_calls = t.total_calls,
    total_call_duration_minutes = t.total_duration_minutes,
    incoming_calls = t.incoming_calls,
    outgoing_calls = t.outgoing_calls,
    missed_calls = t.missed_calls,
    avg_call_duration_minutes = t.avg_duration_minutes,
    first_call_date = t.first_call_date::timestamp,
    last_call_date = t.last_call_date::timestamp,
    call_loyalty_level = t.loyalty_level,
    last_visit = t.last_call_date::timestamp,
    updated_at = NOW()
FROM temp_all_call_log t
WHERE customers.phone = t.phone;

-- Step 5: Show updated customers count
SELECT 'Updated customers:' as info, COUNT(*) as count FROM customers WHERE updated_at > NOW() - INTERVAL '1 minute';

-- Step 6: Show loyalty level distribution after update
SELECT 'Loyalty level distribution:' as info, call_loyalty_level, COUNT(*) as customer_count FROM customers WHERE call_loyalty_level IS NOT NULL GROUP BY call_loyalty_level ORDER BY customer_count DESC;

-- Step 7: Show top customers by call activity
SELECT 'Top customers by call activity:' as info, name, phone, total_calls, ROUND(total_call_duration_minutes, 1) as total_duration_minutes, call_loyalty_level FROM customers WHERE total_calls > 0 ORDER BY total_calls DESC, total_call_duration_minutes DESC LIMIT 20;